        <p style=""text-align:justify"">
            Worms are so effective at processing organic waste that they can digest almost half their own weight in debris every day. Vermicomposting is a simple composting process that
            takes advantage of what earthworms do naturally, but confines the worms to bins making it easier for farmers to feed them and to harvest
            their nutrient-rich compost. Since all worms digest organic matter, in principle, any type of worm can be used; however, not all are
